  [],\n\t\"num_tags\": 0,\n\t\"name\": \"afsc-abl-2006-chum-salmon-bycatch-sample-analysis-bering-sea\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A genetic analysis of samples from the
  chum salmon (Oncorhynchus keta) bycatch of the 2006 Bering Sea walleye pollock (Theragra
  chalcogramma) trawl fishery was undertaken to determine the overall stock composition
  of the sample set. Samples were genotyped for eleven microsatellite markers and
  results were estimated using the current chum salmon microsatellite baseline. In
  2006, genetic samples were collected opportunistically as part of a special project,
  but sample biases have the potential to affect stock composition analysis results.
  \ Consequently, stock composition estimates apply to the sample set and may not
  represent the entire chum salmon bycatch.  Based on the analysis of 1,367 chum salmon
  bycatch samples collected throughout the 2006 Bering Sea trawl fishery, North Asian
  (31%), East Asian (29%), and Pacific Northwest (25%) stocks dominated the sample
  set with smaller contributions from Western Alaska (8%) and Upper/Middle Yukon River
  (6%) stocks.  The estimates for the 2006 chum salmon bycatch sample set were similar
  to the 2005 and 2009 chum salmon bycatch estimates, suggesting consistency of the
  regional stock contributions across years. Analysis of temporal groupings within
  the groundfish B season revealed changes in stock composition during the course
  of the season with decreasing contribution of Upper/Middle Yukon stocks over time,
  but leaves unanswered whether these changes are due to temporal or spatial differences
  in the sample set.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
